--
-- Name: user_to_zone_roles; Type: MATERIALIZED VIEW; Schema: public; Owner: postgres
--

CREATE MATERIALIZED VIEW public.user_to_zone_roles AS
 WITH RECURSIVE zone_assign_expanded(login, zid, zone_role, account_type) AS (
         SELECT za.login,
            za.zid,
            za.zone_role,
            u.account_type
           FROM (public.zone_assign za
             JOIN public.users u ON ((za.login = u.login)))
        UNION
         SELECT g.login,
            za.zid,
            za.zone_role,
            u.account_type
           FROM ((zone_assign_expanded za
             JOIN public.groups g ON ((g."group" = za.login)))
             JOIN public.users u ON ((g.login = u.login)))
        )
 SELECT zone_assign_expanded.login,
    zone_assign_expanded.zid,
    min(zone_assign_expanded.zone_role) AS zone_role
   FROM zone_assign_expanded
  WHERE (zone_assign_expanded.account_type < 100)
  GROUP BY zone_assign_expanded.zid, zone_assign_expanded.login
  WITH NO DATA;


